import React, { Component } from 'react';
// import logo from './logo.svg';
import './App.css';

let fakeServerData ={
  user: {
    name: "Steven",
    playlists:[
      {name: "Love songs",
      songs:[
        {name:"Beat it", duration:1234},
        {name:"I like you", duration:1234}
      ]
      },
      {name: "Hit songs",
      songs:[
        {name:"Last Christmas", duration:1234},
        {name:"All I Want For Christmas Is You", duration:1234}
      ]
      },
      {name: "Seasons songs",
      songs:[
        {name:"Fall", duration:1234},
        name:"Summer", duration:1234
      ]
      }
    ]
  }
}
class Aggregate extends Component {
  render(){
    return(
      <div style={{ width:'40%',display:'inline-block'}}>
        <h2>{this.props.playlists&&this.props.playlists.length} Text</h2>
      </div>
    )
  }
}

class Filter extends Component{
  render() {
    return (
      <div>
        <img/>
        <input type="text"/>
      </div>
    )
  }
}

class Playlist extends Component{
  render(){
    return (
      <div style={{width:"25%", display:"inline-block"}}>
        <img/> 
        <h3>Playlist Name</h3>
        <ul>
          <li>Song 1</li>
          <li>Song 2</li>
          <li>Song 3</li>
        </ul>
      </div>
    );
  }
}

class App extends Component {
  constructor(){
    super();
    this.state = {serverData:{}}
  }
  componentDidMount(){
    this.setState({serverData: fakeServerData});
  }
  render() { 
    return (
      <div className="App">
        <h1 className="App-header">
        {this.state.serverData.user && this.state.serverData.user.name}'s Favorite Playlists
        </h1>
        <Aggregate playlists= {this.state.serverData.user && this.state.serverData.user.name}/>
        <Aggregate/>
        <Filter/>
        <Playlist/>
        <Playlist/>
        <Playlist/>
      </div>
    );
  }
}

export default App;
